sys_variable_value.value:
(function execute(inputs, outputs) {
    var responseBody = JSON.parse(inputs.responseBody);
    var zones = responseBody.items;
    var listZones = [];
    zones.forEach(function(zone) {
        listZones.push({
            'label': zone.name.toUpperCase(),
            'name': zone.name
        });

    })
    outputs.zones = {
        data: listZones
    }
})(inputs, outputs);

